css:
.isearch .find-container {
  display: -webkit-flex;
  -webkit-flex-direction: row;
}
.isearch .find-container .btn-group {
  margin-left: 10px;
}
.isearch .find-container .editor-container {
  position: relative;
  -webkit-flex: 1;
}
.isearch .find-container .editor-container atom-text-editor {
  width: 100%;
}
atom-text-editor::shadow .isearch-result .region,
atom-text-editor .isearch-result .region {
  background-color: transparent;
  border-radius: 3px;
  border: 1px solid #404040;
}
atom-text-editor::shadow .isearch-current .region,
atom-text-editor .isearch-current .region {
  background-color: transparent;
  border-radius: 3px;
  border: 1px solid #d6d6d6;
}
